import React, { memo } from "react";
const Container = memo(props => {
  return (
    <div>
      <h1>{props.title}</h1>
      <button onClick={props.handleClick}>click</button>
      <div>
        <input type="text" onChange={props.handleChange} />
      </div>
    </div>
  );
});

export default Container;
